//github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopensc-profile-sc-hsm", "0.17.0-1", "sc-hsm card profile for opensc\\\\\\\\  \\\\\\\\", "0", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopensc-profile-setcos", "0.17.0-1", "setcos card profile for opensc\\\\\\\\  \\\\\\\\", "1", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopensc-profile-starcos", "0.17.0-1", "starcos card profile for opensc\\\\\\\\  \\\\\\\\", "1", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopensc-profile-westcos", "0.17.0-1", "westcos card profile for opensc\\\\\\\\  \\\\\\\\", "1", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopensc", "0.17.0-1", "OpenSC provides a set of libraries and utilities to work with smart cards.\\\\\\\\ Its main focus is on cards that support cryptographic operations, and\\\\\\\\ facilitate their use in security applications such as authentication,\\\\\\\\ mail encryption and digital signatures.\\\\\\\\  \\\\\\\\", "610", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/opensc|Sources]]"], ["libopenssl", "1.0.2s-1", "The OpenSSL Project is a collaborative effort to develop a robust,\\\\\\\\ commercial-grade, full-featured, and Open Source toolkit implementing the Secure\\\\\\\\ Sockets Layer (SSL v2/v3) and Transport Layer Security (TLS v1) protocols as well\\\\\\\\ as a full-strength general purpose cryptography library.\\\\\\\\ This package contains the OpenSSL shared libraries, needed by other programs.\\\\\\\\  \\\\\\\\", "688", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/openssl|Sources]]"], ["libopenzwave", "1.4.164-2", "Open-ZWave Library\\\\\\\\  \\\\\\\\", "304", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/openzwave|Sources]]"], ["liboping", "1.9.0-1", "C library to generate ICMP echo requests.\\\\\\\\  \\\\\\\\", "5", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/liboping|Sources]]"], ["libopus", "1.2.1-1", "Opus is a totally open, royalty-free, highly versatile audio codec. Opus is\\\\\\\\ unmatched for interactive speech and music transmission over the Internet, but\\\\\\\\ is also intended for storage and streaming applications.\\\\\\\\  \\\\\\\\", "151", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/opus|Sources]]"], ["libosip2", "5.0.0-3", "GNU oSIP library, a Session Initiation Protocol (SIP) implementation.\\\\\\\\  \\\\\\\\", "59", "[[https://github.com/openwrt/telephony/tree/openwrt-18.06/libs/libosip2|Sources]]"], ["libout123", "1.25.10-1", "Library for continuous playback of audio streams via various platform-specific output methods\\\\\\\\  \\\\\\\\", "17", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/sound/mpg123|Sources]]"], ["libow-capi", "2.9p5-1", "OWFS is a suite of programs that designed to make the 1-wire bus and its\\\\\\\\ devices easily accessible. The underlying principle is to create a virtual\\\\\\\\ filesystem, with the unique ID being the directory, and the individual\\\\\\\\ properties of the device are represented as simple files that can be read\\\\\\\\ and written.\\\\\\\\  \\\\\\\\ Details of the individual slave or master design are hidden behind a\\\\\\\\ consistent interface. The goal is to provide an easy set of tools for a\\\\\\\\ software designer to create monitoring or control applications. There are\\\\\\\\ some performance enhancements in the implementation, including data caching,\\\\\\\\ parallel access to bus masters, and aggregation of device communication.\\\\\\\\ Still the fundemental goal has been ease of use, flexibility and correctness\\\\\\\\ rather than speed.\\\\\\\\  \\\\\\\\ This package contains the OWFS C-API library.\\\\\\\\  \\\\\\\\", "2", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/owfs|Sources]]"], ["libow", "2.9p5-1", "OWFS is a suite of programs that designed to make the 1-wire bus and its\\\\\\\\ devices easily accessible. The underlying principle is to create a virtual\\\\\\\\ filesystem, with the unique ID being the directory, and the individual\\\\\\\\ properties of the device are represented as simple files that can be read\\\\\\\\ and written.\\\\\\\\  \\\\\\\\ Details of the individual slave or master design are hidden behind a\\\\\\\\ consistent interface. The goal is to provide an easy set of tools for a\\\\\\\\ software designer to create monitoring or control applications. There are\\\\\\\\ some performance enhancements in the implementation, including data caching,\\\\\\\\ parallel access to bus masters, and aggregation of device communication.\\\\\\\\ Still the fundemental goal has been ease of use, flexibility and correctness\\\\\\\\ rather than speed.\\\\\\\\  \\\\\\\\ This package contains the OWFS library.\\\\\\\\  \\\\\\\\", "257", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/owfs|Sources]]"], ["libp11", "0.4.7-1", "Libp11 is a library implementing a small layer on top of PKCS", "37", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libp11|Sources]]"], ["libpagekite", "0.91.171102C-1", "PageKite is a system for running publicly visible servers (generally\\\\\\\\ web servers) on machines without a direct connection to the Internet,\\\\\\\\ such as mobile devices or computers behind restrictive firewalls.\\\\\\\\ PageKite works around NAT, firewalls and IP-address limitations by\\\\\\\\ using a combination of tunnels and reverse proxies.\\\\\\\\  \\\\\\\\ This package provides an implementation of the PageKite Protocol in C,\\\\\\\\ optimized for high-performance or embedded applications.\\\\\\\\  \\\\\\\\  \\\\\\\\ This package contains the core library\\\\\\\\  \\\\\\\\", "124", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/net/pagekitec|Sources]]"], ["libpam", "1.2.0-2", "The Linux-PAM Pluggable Authentication Modules.\\\\\\