//github.com/openwrt/packages/tree/openwrt-18.06/libs/liburcu|Sources]]"], ["libusb-1.0", "1.0.22-1", "libusb is a C library that gives applications easy access to USB devices on\\\\\\\\ many different operating systems.\\\\\\\\  \\\\\\\\", "26", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/libusb|Sources]]"], ["libusb-compat", "0.1.5-1", "libusb is a C library that gives applications easy access to USB devices on\\\\\\\\ many different operating systems.\\\\\\\\  \\\\\\\\", "5", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/libusb-compat|Sources]]"], ["libusbmuxd-utils", "1.1.0-2", "This daemon is in charge of multiplexing connections over USB to an iPhone or\\\\\\\\ iPod touch. To users, it means you can sync your music, contacts, photos, etc.\\\\\\\\ over USB. To developers, it means you can connect to any listening localhost\\\\\\\\ socket on the device. usbmuxd is not used for tethering data transfer, which\\\\\\\\ uses a dedicated USB interface as a virtual network device.\\\\\\\\ This package contains the libusbmuxd utilities.\\\\\\\\  \\\\\\\\", "4", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libusbmuxd|Sources]]"], ["libusbmuxd", "1.1.0-2", "This daemon is in charge of multiplexing connections over USB to an iPhone or\\\\\\\\ iPod touch. To users, it means you can sync your music, contacts, photos, etc.\\\\\\\\ over USB. To developers, it means you can connect to any listening localhost\\\\\\\\ socket on the device. usbmuxd is not used for tethering data transfer, which\\\\\\\\ uses a dedicated USB interface as a virtual network device.\\\\\\\\ This package contains the libusbmuxd shared library.\\\\\\\\  \\\\\\\\", "10", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libusbmuxd|Sources]]"], ["libustream-mbedtls", "2018-07-30-23a3f283-1", "ustream SSL Library (mbedtls)\\\\\\\\  \\\\\\\\", "3", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/ustream-ssl|Sources]]"], ["libustream-openssl", "2018-07-30-23a3f283-1", "ustream SSL Library (openssl)\\\\\\\\  \\\\\\\\", "3", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/ustream-ssl|Sources]]"], ["libustream-wolfssl", "2018-07-30-23a3f283-1", "ustream SSL Library (wolfssl)\\\\\\\\  \\\\\\\\", "3", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/ustream-ssl|Sources]]"], ["libuuid", "2.32-2", "The UUID library is used to generate unique identifiers for objects\\\\\\\\ that may be accessible beyond the local system. This library\\\\\\\\ generates UUIDs compatible with those created by the Open Software\\\\\\\\ Foundation (OSF) Distributed Computing Environment (DCE) utility.\\\\\\\\  \\\\\\\\", "11", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/utils/util-linux|Sources]]"], ["libuv", "1.19.2-1", "libuv is a multi-platform support library with a focus on asynchronous I/O. It\\\\\\\\ was primarily developed for use by Node.js, but it's also used by Luvit, Julia,\\\\\\\\ pyuv, and others.\\\\\\\\  \\\\\\\\", "48", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuv|Sources]]"], ["libuvc", "0.0.5-20140812-2c6403405872aa865999b95ba15944295adf6c38-1", "This package contains libuvc is a cross-platform library for USB video devices,\\\\\\\\ built atop libusb.\\\\\\\\  \\\\\\\\", "17", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuvc|Sources]]"], ["libuwsc-mbedtls", "2.0.2-1", "Lightweight WebSocket client library (mbedtls)\\\\\\\\  \\\\\\\\", "5", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuwsc|Sources]]"], ["libuwsc-nossl", "2.0.2-1", "Lightweight WebSocket client library (NO SSL)\\\\\\\\  \\\\\\\\", "4", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuwsc|Sources]]"], ["libuwsc-openssl", "2.0.2-1", "Lightweight WebSocket client library (openssl)\\\\\\\\  \\\\\\\\", "5", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuwsc|Sources]]"], ["libuwsc-wolfssl", "2.0.2-1", "Lightweight WebSocket client library (wolfssl)\\\\\\\\  \\\\\\\\", "5", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libuwsc|Sources]]"], ["libv4l", "1.10.0-1", "libv4l is a collection of libraries which adds a thin abstraction layer on\\\\\\\\ top of video4linux2 devices. The purpose of this (thin) layer is to make it\\\\\\\\ easy for application writers to support a wide variety of devices without\\\\\\\\ having to write separate code for different devices in the same class. libv4l\\\\\\\\ consists of 3 different libraries: libv4lconvert, libv4l1 and libv4l2.\\\\\\\\  \\\\\\\\ libv4l1 offers the (deprecated) v4l1 API on top of v4l2 devices, independent\\\\\\\\ of the drivers for those devices supporting v4l1 compatibility (which many\\\\\\\\ v4l2 drivers do not).\\\\\\\\  \\\\\\\\ libv4l2 offers the v4l2 API on top of v4l2 devices, while adding for the\\\\\\\\ application transparent libv4lconvert conversion where necessary.\\\\\\\\  \\\\\\\\", "72", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libv4l|Sources]]"], ["libvorbis", "1.3.6-1", "Vorbis is a general purpose audio and music encoding format\\\\\\\\ contemporary to MPEG-4's AAC and TwinVQ, the next generation beyond\\\\\\\\ MPEG audio layer 3. Unlike the MPEG sponsored formats (and other\\\\\\\\ proprietary formats such as RealAudio G2 and Windows' flavor of the\\\\\\\\ month), the Vorbis CODEC specification belongs to the public domain.\\\\\\\\ All the technical details are published and documented, and any\\\\\\\\ software entity may make full use of the format without license\\\\\\\\ fee, royalty or patent concerns.\\\\\\\\  \\\\\\\\", "187", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libvorbis|Sources]]"], ["libvorbisidec", "1.0.3-20150104-3", "libvorbisidec is \"tremor\", a fixed-point implementation of libvorbis.\\\\\\\\ It also has libogg built-in. It is suitable as a replacement for\\\\\\\\ libvorbis and libogg in tremor-aware applications.\\\\\\\\ Tremor is a decoder only.\\\\\\\\  \\\\\\\\", "65", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libvorbisidec|Sources]]"], ["mikrotik-btest", "0.5.1-1", "A bandwidth test client compatible with Mikrotik's RouterOS BTest server.\\\\\\\\  \\\\\\\\", "7", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/net/mikrotik-btest|Sources]]"], ["libvpx", "1.7.0-1", "libvpx is a VP8/VP9 Codec SDK.\\\\\\\\  \\\\\\\\", "499", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libvpx|Sources]]"], ["libwebcam", "0.2.4", "The webcam-tools package contains the following two components:\\\\\\\\ - libwebcam: Webcam Library (LGPL)\\\\\\\\ - uvcdynctrl: Manage dynamic controls in uvcvideo (GPL)\\\\\\\\  \\\\\\\\", "18", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/utils/uvcdynctrl|Sources]]"], ["libwebsockets-full", "2.4.1-2", "libwebsockets (Full - OpenSSL, libuv, plugins, CGI)\\\\\\\\  \\\\\\\\", "71", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libwebsockets|Sources]]"], ["libwebsockets-mbedtls", "2.4.1-2", "libwebsockets (mbedTLS)\\\\\\\\  \\\\\\\\", "63", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libwebsockets|Sources]]"], ["libwebsockets-openssl", "2.4.1-2", "libwebsockets (OpenSSL)\\\\\\\\  \\\\\\\\", "59", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/libwebsockets|Sources]]"], ["libwolfssl", "3.15.3-stable-2", "wolfSSL (formerly CyaSSL) is an SSL library optimized for small\\\\\\\\ footprint, both on disk and for memory use.\\\\\\\\  \\\\\\\\", "252", "[[https://github.com/openwrt/openwrt/tree/openwrt-18.06/package/libs/wolfssl|Sources]]"], ["libwrap", "7.6-1", "Security wrapper library for TCP services\\\\\\\\  \\\\\\\\", "9", "[[https://github.com/openwrt/packages/tree/openwrt-18.06/libs/tcp_wrappers|Sources]]"], ["libxerces-c-samples", "3.2.0-1", "Validating XML parser library for C++ (samples)\\\\\\\\  \\\\\\\\", "1